var myGlobalvalues = {
    issupervisor:false, //공장설정 가능 슈퍼바이저 
    islocal: false,  // 로컬, 원격
    isuseradmin: false, // 사용자 관리자계정(장비설정가능) 나머지 그냥 뷰어
    farmapi: undefined
  }
  
export default myGlobalvalues;
